import React from "react";
import Header from "./Header";
import TopImage from "./TopImage";
import Topic from "./Topic";
import Footer from "./Footer";
import style from "../static/Style";

const Layout = () => (
  <div>
    {style}
    <Header />
    <TopImage />
    <Topic />
    <Footer />
  </div>
);

export default Layout;
